import React from 'react';
import * as actions from '../../actions';
import { connect } from 'react-redux';

class SurveyEdit extends React.Component {
    
    state = { survey: [] }

    componentDidMount() {
        const item = this.props.fetchSurvey(this.props.match.params.id);
        item.then(result => this.setState({ survey: result }));
        // this.setState({
        //     survey: item
        // })
    }


    render() {
        return(
            <div>
                {console.log(this.props.match.params.id)}
                Survey Edit
                {this.state.survey}
            </div>
        )
    }
}

export default connect(null, actions)(SurveyEdit);
